import React, { useState } from 'react';
import { View, Text, ScrollView, StyleSheet, SafeAreaView, Alert } from 'react-native';

const DocumentUploadScreen = ({ navigation, route }) => {
  const { service, provider } = route.params || {};
  const [uploadedDocs, setUploadedDocs] = useState({});

  const requiredDocuments = [
    { id: 'identity', title: 'Identity Proof', subtitle: 'Aadhaar Card / PAN Card / Passport', required: true },
    { id: 'address', title: 'Address Proof', subtitle: 'Utility Bill / Rent Agreement', required: true },
    { id: 'photo', title: 'Passport Photo', subtitle: 'Recent photograph', required: true },
  ];

  const handleUpload = (docId, docTitle) => {
    const options = ['Camera', 'Gallery', 'PDF', 'Cancel'];
    const choice = window.confirm(`Upload ${docTitle}\n\nClick OK for Camera, Cancel to see more options`);
    
    if (choice) {
      // Camera selected
      const fileName = `${docId}_${Date.now()}.jpg`;
      const fileSize = Math.floor(Math.random() * 3000000) + 500000;
      
      setUploadedDocs(prev => ({
        ...prev,
        [docId]: {
          name: fileName,
          size: fileSize,
          method: 'camera',
          date: new Date().toLocaleString(),
        }
      }));

      window.alert(`‚úì Success!\n\nDocument uploaded: ${fileName}\nSize: ${(fileSize / 1024 / 1024).toFixed(2)} MB`);
    } else {
      // Show more options
      const method = window.prompt(`Upload ${docTitle}\n\nEnter:\n1 for Camera\n2 for Gallery\n3 for PDF\n\nOr click Cancel`, '1');
      
      if (method) {
        const methodMap = { '1': 'camera', '2': 'gallery', '3': 'pdf' };
        const selectedMethod = methodMap[method] || 'camera';
        const ext = selectedMethod === 'pdf' ? 'pdf' : 'jpg';
        const fileName = `${docId}_${Date.now()}.${ext}`;
        const fileSize = Math.floor(Math.random() * 3000000) + 500000;
        
        setUploadedDocs(prev => ({
          ...prev,
          [docId]: {
            name: fileName,
            size: fileSize,
            method: selectedMethod,
            date: new Date().toLocaleString(),
          }
        }));

        window.alert(`‚úì Success!\n\nDocument uploaded: ${fileName}\nSize: ${(fileSize / 1024 / 1024).toFixed(2)} MB`);
      }
    }
  };

  const handleRemove = (docId) => {
    if (window.confirm('Remove this document?')) {
      const newDocs = { ...uploadedDocs };
      delete newDocs[docId];
      setUploadedDocs(newDocs);
      window.alert('‚úì Document removed');
    }
  };

  const formatSize = (bytes) => {
    return (bytes / 1024 / 1024).toFixed(2) + ' MB';
  };

  const progress = {
    uploaded: requiredDocuments.filter(doc => uploadedDocs[doc.id]).length,
    total: requiredDocuments.length,
  };

  const canContinue = progress.uploaded === progress.total;

  return (
    <SafeAreaView style={styles.container}>
      {/* Header */}
      <View style={styles.header}>
        <button 
          onClick={() => navigation.goBack()} 
          style={{
            padding: '8px 16px',
            backgroundColor: 'transparent',
            border: 'none',
            color: '#1E40AF',
            fontSize: '16px',
            fontWeight: '600',
            cursor: 'pointer',
          }}
        >
          ‚Üê Back
        </button>
        <View style={styles.headerContent}>
          <Text style={styles.headerTitle}>Upload Documents</Text>
          <Text style={styles.headerSubtitle}>
            {provider?.name || 'Provider'} ‚Ä¢ {service?.title || 'Service'}
          </Text>
        </View>
      </View>

      <ScrollView style={styles.scrollView}>
        {/* Progress */}
        <View style={styles.progressCard}>
          <Text style={styles.progressTitle}>
            Progress: {progress.uploaded}/{progress.total}
          </Text>
          <View style={styles.progressBarBg}>
            <View 
              style={[
                styles.progressBarFill, 
                { width: `${(progress.uploaded / progress.total) * 100}%` }
              ]} 
            />
          </View>
          <Text style={styles.progressText}>
            {canContinue ? '‚úì All documents uploaded!' : `${progress.total - progress.uploaded} more needed`}
          </Text>
        </View>

        {/* Documents */}
        <View style={styles.section}>
          <Text style={styles.sectionTitle}>Required Documents</Text>
          
          {requiredDocuments.map((doc) => {
            const uploaded = uploadedDocs[doc.id];
            
            return (
              <View key={doc.id} style={styles.docCard}>
                <View style={styles.docHeader}>
                  <View style={[styles.badge, uploaded && styles.badgeSuccess]}>
                    <Text style={styles.badgeText}>
                      {uploaded ? '‚úì' : doc.title.charAt(0)}
                    </Text>
                  </View>
                  <View style={styles.docInfo}>
                    <Text style={styles.docTitle}>{doc.title}</Text>
                    <Text style={styles.docSubtitle}>{doc.subtitle}</Text>
                  </View>
                </View>

                {uploaded ? (
                  <View style={styles.uploadedBox}>
                    <Text style={styles.uploadedText}>
                      üìÑ {uploaded.name}
                    </Text>
                    <Text style={styles.uploadedMeta}>
                      {formatSize(uploaded.size)} ‚Ä¢ {uploaded.method} ‚Ä¢ {uploaded.date}
                    </Text>
                    <View style={styles.buttonRow}>
                      <button
                        onClick={() => handleUpload(doc.id, doc.title)}
                        style={{
                          flex: 1,
                          padding: '10px',
                          borderRadius: '6px',
                          border: '1px solid #1E40AF',
                          backgroundColor: 'white',
                          color: '#1E40AF',
                          fontSize: '14px',
                          fontWeight: '600',
                          cursor: 'pointer',
                        }}
                      >
                        Replace
                      </button>
                      <button
                        onClick={() => handleRemove(doc.id)}
                        style={{
                          flex: 1,
                          padding: '10px',
                          borderRadius: '6px',
                          border: '1px solid #EF4444',
                          backgroundColor: 'white',
                          color: '#EF4444',
                          fontSize: '14px',
                          fontWeight: '600',
                          cursor: 'pointer',
                          marginLeft: '8px',
                        }}
                      >
                        Remove
                      </button>
                    </View>
                  </View>
                ) : (
                  <button
                    onClick={() => handleUpload(doc.id, doc.title)}
                    style={{
                      width: '100%',
                      padding: '14px',
                      borderRadius: '8px',
                      border: 'none',
                      backgroundColor: '#1E40AF',
                      color: 'white',
                      fontSize: '16px',
                      fontWeight: '600',
                      cursor: 'pointer',
                    }}
                  >
                    Upload Document +
                  </button>
                )}
              </View>
            );
          })}
        </View>

        {/* Continue */}
        <View style={styles.section}>
          <button
            onClick={() => {
              if (canContinue) {
                navigation.navigate('FinalForm', { service, provider, documents: uploadedDocs });
              } else {
                window.alert(`‚ö†Ô∏è Missing Documents\n\nPlease upload all ${progress.total} required documents`);
              }
            }}
            disabled={!canContinue}
            style={{
              width: '100%',
              padding: '16px',
              borderRadius: '12px',
              border: 'none',
              backgroundColor: canContinue ? '#1E40AF' : '#CBD5E1',
              color: 'white',
              fontSize: '16px',
              fontWeight: '600',
              cursor: canContinue ? 'pointer' : 'not-allowed',
            }}
          >
            {canContinue ? 'Continue to Form ‚Üí' : `Upload ${progress.total - progress.uploaded} More`}
          </button>
        </View>

        <View style={{ height: 40 }} />
      </ScrollView>
    </SafeAreaView>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#F8FAFC',
  },
  header: {
    flexDirection: 'row',
    alignItems: 'center',
    padding: 16,
    backgroundColor: '#FFFFFF',
    borderBottomWidth: 1,
    borderBottomColor: '#E2E8F0',
  },
  headerContent: {
    flex: 1,
  },
  headerTitle: {
    fontSize: 20,
    fontWeight: '700',
    color: '#0F172A',
  },
  headerSubtitle: {
    fontSize: 12,
    color: '#475569',
    marginTop: 2,
  },
  scrollView: {
    flex: 1,
  },
  progressCard: {
    margin: 16,
    padding: 16,
    backgroundColor: '#FFFFFF',
    borderRadius: 12,
    borderWidth: 1,
    borderColor: '#E2E8F0',
  },
  progressTitle: {
    fontSize: 16,
    fontWeight: '600',
    color: '#0F172A',
    marginBottom: 8,
  },
  progressBarBg: {
    height: 8,
    backgroundColor: '#E2E8F0',
    borderRadius: 4,
    overflow: 'hidden',
    marginBottom: 8,
  },
  progressBarFill: {
    height: '100%',
    backgroundColor: '#1E40AF',
  },
  progressText: {
    fontSize: 14,
    color: '#475569',
  },
  section: {
    paddingHorizontal: 16,
    marginTop: 16,
  },
  sectionTitle: {
    fontSize: 18,
    fontWeight: '700',
    color: '#0F172A',
    marginBottom: 12,
  },
  docCard: {
    backgroundColor: '#FFFFFF',
    borderRadius: 12,
    padding: 16,
    marginBottom: 12,
    borderWidth: 1,
    borderColor: '#E2E8F0',
  },
  docHeader: {
    flexDirection: 'row',
    marginBottom: 12,
  },
  badge: {
    width: 48,
    height: 48,
    borderRadius: 8,
    backgroundColor: '#1E40AF',
    alignItems: 'center',
    justifyContent: 'center',
    marginRight: 12,
  },
  badgeSuccess: {
    backgroundColor: '#10B981',
  },
  badgeText: {
    fontSize: 20,
    fontWeight: '700',
    color: '#FFFFFF',
  },
  docInfo: {
    flex: 1,
    justifyContent: 'center',
  },
  docTitle: {
    fontSize: 16,
    fontWeight: '600',
    color: '#0F172A',
    marginBottom: 4,
  },
  docSubtitle: {
    fontSize: 14,
    color: '#475569',
  },
  uploadedBox: {
    backgroundColor: '#F8FAFC',
    borderRadius: 8,
    padding: 12,
  },
  uploadedText: {
    fontSize: 14,
    fontWeight: '600',
    color: '#0F172A',
    marginBottom: 4,
  },
  uploadedMeta: {
    fontSize: 12,
    color: '#475569',
    marginBottom: 12,
  },
  buttonRow: {
    flexDirection: 'row',
  },
});

export default DocumentUploadScreen;
